import React, { useContext, useEffect } from "react";
import { WishlistContext } from "./WishlistContext";

export default function Wishlist() {
    let { getAllProductsOnWishlist } = useContext(WishlistContext);
    async function getAllWishlist() {
        let { data } = await getAllProductsOnWishlist();
        console.log(data);
    }

  useEffect(() => {
    getAllWishlist();
  }, []);
  return (
    <>
      <h4>hello</h4>
    </>
  );
}
